function App() {


  return (
    <div className="App">
      <div className="search-bar">
      <input
        id="searchBar"
        type="text"
        ></input>


      </div>

   <div className="fish-container">
        {
          filteredCreatures.map(creature => creature.location === "River" && (
            <CreatureCard
              name={creature.name}
              location={creature.location}
              price={creature.price}
            />))}

      </div> 


      <div className="bugs-container">
        {bugList.map(creature => (
          <CreatureCard
            name={creature.name}
            location={creature.location}
            price={creature.price}
          />
        ))}
      </div>
    </div>
  );
}


export default App;
